// Vérifications et lecture des champs
// ***********************************

// Si ce n'est pas une erreur, on sort
if (!doc.containsKey('psl.severite') || doc['psl.severite'].size() == 0 ||  doc['psl.severite'].value != "ERROR") {
  return;
}

// Si pas de message ou de nom d'application, on sort
if (!doc.containsKey('psl.message')
    || !doc.containsKey('psl.classe') || doc['psl.classe'].size() == 0
	|| !doc.containsKey('psl.runtime.nomApplication') || doc['psl.runtime.nomApplication'].size() == 0) {
  return;
}

// lecture
def msg = params._source.psl.message;
def appli = doc['psl.runtime.nomApplication'].value;
def classe = doc['psl.classe'].value;

// ***********************************
// Cas communs
// ***********************************
if (msg.contains('com.github.talbotgui.psl.socle.commun.apiclient.ApiClientException')) {
  emit('COMMUN_01_erreurAppelApi');
  return;
}
else if (classe.contains('DiscoveryClient')) {
  emit('COMMUN_02_erreurCommunicationAvecLeRegistre');
  return;
}
else if ((msg.contains('java.lang.IllegalStateException: org.springframework.context.annotation.AnnotationConfigApplicationContext') && msg.contains('has been closed already'))
    || (classe.contains('SpringApplication') && msg.contains('Application run failed'))
	|| (classe.contains('LoggingFailureAnalysisReporter') && msg.contains('APPLICATION FAILED TO START'))) {
  emit('COMMUN_03_erreurDemarrageApplicatif');
  return;
}
else if (msg.contains('Aucun document correspondant à mettre à jour')) {
  emit('COMMUN_04_erreurMaJDansMongoDB');
  return;
}
else if (classe.contains('ExceptionHandler')) {
  if (msg.contains('Erreur traitée sur la requête /socle/soumission')) {
    emit('COMMUN_05a_erreurGeneriqueAppelApiSocleSoumission');
    return;
  }
  else if (msg.contains('Erreur traitée sur la requête /socle/document')) {
    emit('COMMUN_05b_erreurGeneriqueAppelApiSocleDocument');
    return;
  }
  else if (msg.contains('Erreur traitée sur la requête /socle/configuration')) {
    emit('COMMUN_05c_erreurGeneriqueAppelApiSocleConfiguration');
    return;
  }
  else if (msg.contains('Erreur traitée sur la requête /socle/adminpsl')) {
    emit('COMMUN_05d_erreurGeneriqueAppelApiSocleAdminpsl');
    return;
  }
  else if (msg.contains('Erreur traitée sur la requête /socle/brouillon')) {
    emit('COMMUN_05e_erreurGeneriqueAppelApiSocleBrouillon');
    return;
  }
  else if (msg.contains('Erreur traitée sur la requête /socle/notification')) {
    emit('COMMUN_05f_erreurGeneriqueAppelApiSocleNotification');
    return;
  }
  else if (msg.contains('Erreur traitée sur la requête /socle/referentielexterne')) {
    emit('COMMUN_05g_erreurGeneriqueAppelApiSocleReferentielExterne');
    return;
  }
  else if (msg.contains('Erreur traitée sur la requête /socle/referentiel')) {
    emit('COMMUN_05h_erreurGeneriqueAppelApiSocleReferentiel');
    return;
  }
  else if (msg.contains('Erreur traitée sur la requête /socle/securite')) {
    emit('COMMUN_05i_erreurGeneriqueAppelApiSocleReferentiel');
    return;
  }
  else if (msg.contains('Erreur traitée sur la requête /socle/transfert')) {
    emit('COMMUN_05j_erreurGeneriqueAppelApiSocleTransfert');
    return;
  }
  // jamais de ELSE dans ce script car géré en fin de script
}
else if (classe.contains('InitialisationMongoDBUtils')) {
  emit('COMMUN_06_warningInitJeuDeDonneesSurPosteLocal');
  return;
}
else if (classe.contains('TestContextManager')) {
  emit('COMMUN_07_warningDemarrageTestAutomatise');
  return;
}


// ***********************************
// DOCUMENT
// ***********************************
else if (appli == 'socle-dbdocument') {
  // Pb de téléchargement
  if (msg.contains('Tentative de téléchargement du document')) {
    emit('DOCUMENT_01_erreurTelechargementDocument');
    return;
  }
  // Upload refusé
  else if (classe.contains('PieceJointeServiceImpl') && msg.contains('Fichier refusé')) {
    emit('DOCUMENT_02_erreurUploadTropLourd');
    return;
  }
  // jamais de ELSE dans ce script car géré en fin de script
}

// ***********************************
// NOTIFICATION
// ***********************************
else if (appli == 'socle-dbnotification') {
  
  // Cas présent dans les tests automatisés
  if (msg.contains('java.lang.RuntimeException: boum') || msg.contains('java.lang.RuntimeException: boumAuPremierAppel')) {
    emit('NOTIFICATION_01_warningDeTest');
    return;
  }
  else if (msg.contains('Erreur durant la recherche et l\'envoi d\'une notification')) {
    emit('NOTIFICATION_02_erreurEnvoiNotification');
    return;
  }
  // jamais de ELSE dans ce script car géré en fin de script
}

// ***********************************
// SOUMISSION
// ***********************************
else if (appli == 'socle-soumission') {

  // messages d'erreur spécifiques
  if (msg.contains('Aucun tokenPSL fourni alors que le point d\'entrée demande une authentification') || msg.contains('FAILLE DE SECURITE ! TokenPSL fourni invalide') || msg.contains('TokenPSL et données soumises incohérentes')) {
    emit('SOUMISSION_01_warningValidationSecurite');
    return;
  }
  // Cette classe n'appelle rien mais génère des logs spécifiques
  else if (classe.contains('ValidationSoumissionServiceImpl') && !msg.contains('caused by')) {
    emit('SOUMISSION_02_warningValidationAutre');
    return;
  }
  //
  else if (classe.contains('SoumissionPieceJointeServiceImpl')) {
    emit('SOUMISSION_03_erreurPJ');
    return;
  }
  else if (classe.contains('SoumissionServiceImpl') && msg.contains('Erreur durant la génération des documents et l\'association des pièces jointes du télé-dossier')) {
    emit('SOUMISSION_04_erreurGenerationDocument');
    return;
  }
  else if (msg.contains('Erreur durant la compensation du télé-dossier') && msg.contains('Action manuelle potentiellement nécessaire')) {
    emit('SOUMISSION_05_erreurCompensationErreur');
    return;
  }  
  // jamais de ELSE dans ce script car géré en fin de script 
}

// ***********************************
// SERVICE REGISTRE
// ***********************************
else if (appli == 'service-registry') {
  if (classe.contains('ReplicationTaskProcessor')) {
    emit('SERVICE_REGISTRE_01_erreurCommunicationEntreApplicatifs');
    return;
  }
}

// ***********************************
// jamais de ELSE dans ce script car géré en fin de script
// ***********************************

// ***********************************
// Cas par défaut
// ***********************************
emit('inconnue');"}}}
